import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row, Navbar} from 'react-bootstrap';


const Home = () => {
    const SideBar = (props) => {
        return (
            <div className='side-bar'>
                <Col>
                    <Row className='side-bar-menu'>
                        <a href="/">MenuA</a>
                    </Row>
                    <Row className='side-bar-menu'>
                        <a href="/">MenuB</a>
                    </Row>
                </Col>
            </div>
        )
    }
    return (
        <div>
            <Navbar>
                    <a href="/">
                        <img className='logo' src={require('../resources/img/dearToday.PNG')} />
                    </a>

            </Navbar>
                <Row>
                    <Col md={2} ><SideBar/></Col>
                    <Col md={10} >Main content</Col>
                </Row>
        </div>
    );
};

export default Home;
